// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
//import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.3.0/contracts/token/ERC20/ERC20.sol";
//import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.3.0/contracts/access/Ownable.sol";

contract IdoDFY is Ownable {

    IERC20 private DFYToken = IERC20(address(0xB6bd9Bba44C8369D47f07CcC9032e65E811A112d));

    struct ExchangeValue {
        uint256 outputDFYNumber;
        uint256 inputTokenNumber;
        bool isExist;
    }

    mapping(address => ExchangeValue) public exchangeValues;

    function upsertExchangePair(address tokenAddress,uint256 outputDFYNumber,uint256 inputTokenNumber) public onlyOwner {
        exchangeValues[tokenAddress] = ExchangeValue(outputDFYNumber, inputTokenNumber, true);
    }

    function deleteExchangePair(address tokenAddress) public onlyOwner {
        require(exchangeValues[tokenAddress].isExist);

        delete exchangeValues[tokenAddress];
    }

    function getOwner() external view returns (address) {
        return owner();
    }

    event BuyIdoSuccess(uint256 amount);

    function buyIdo(address tokenAddress, uint256 amount) external {
        require(exchangeValues[tokenAddress].isExist, "Exchange pair is not exist!");

        IERC20 transferToken = IERC20(tokenAddress);

        require(transferToken.balanceOf(msg.sender) > amount, "Transfer token balance to low");

        uint256 outputDFYAmount = exchangeValues[tokenAddress].outputDFYNumber * amount / exchangeValues[tokenAddress].inputTokenNumber;

        require(DFYToken.balanceOf(address(this)) > outputDFYAmount, "DFY token not enought");

        require(DFYToken.approve(msg.sender, outputDFYAmount), "DFY approve failed!");

        require(DFYToken.transfer(msg.sender, outputDFYAmount), "Token DFY allowance too low");

        // require  DFY.approve(owner(), amount)
        require(transferToken.transferFrom(msg.sender, owner(), amount), "Token transfer allowance too low");

        emit BuyIdoSuccess(outputDFYAmount);
    }
}
